import React, { useEffect, useState } from "react";
import { FootwearWrapper} from "./style";
import TitlePage from "../../Component/Title";
import _ from 'lodash';
import TabPage from "../../Component/TabPage";
const Product = props => {
    const {products,TitlePage} = props
    
    return(
        <FootwearWrapper className="product">
            <TitlePage name="Giày Dép"/>
            <div className="page container">
                <TabPage  products={products} nameLink="Trang chủ / " to="/" nameTabs="Giày Dép"/>
            </div>
        </FootwearWrapper>
    );
}
export default Product;
